Event.Handler:
static function void onOrderForecastCalculationProgressUpdate(
  string Username,
  string ProgressMessage,
  int Progress
)
{
  DebugLib.Logger.WriteInfoLine(string.Format("User {0}, calculation progress: {1}, %: {2}", Username, ProgressMessage, Progress));
}

static function void onOrderCalculationStarted(
  int orderForecastId,
  string user
)
{
  DebugLib.Logger.WriteInfoLine("onOrderCalculationStarted was fired.");

  ThreadLib.Thread.RunAsync(a => {
    bool withErrors = false;
    string errorDesc = "";
    Exception exc;
    try {
      Domain.OrderForecastDetails.CalculateOrderProposal(true, orderForecastId, user);
    }
    catch Exception x {
      withErrors = true;
      errorDesc = x.Message;
      exc = x;
    }

    Events.OrderCalculationEnded.Raise(user, withErrors, errorDesc, exc);
  });

}

static function void onOrderCalculationEnded(
  string user,
  bool withErrors,
  string errorDesc,
  Exception exc
)
{

}

